import React, { useState } from 'react';
import Sidebar from '../Frontend/src/components/Sidebar';
import Header from '../Frontend/src/components/Header';
import Entity from '../Frontend/src/components/Entity';
import Sentimentscore from '../Frontend/src/components/Sentimentscore';
import News from '.../Frontend/src/components/News';
import Entityvisuals from '../Frontend/src/components/entityvisuals';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Header/>
        <Entity/>
        <Sentimentscore/>
        <Sidebar/>
        <Entityvisuals/>
        <News/>
      </header>
    </div>
  );
}

export default App;
